import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../components/Navigation/Navigation';
import Navigation from '../components/Navigation/Navigation';


class App extends Component {

  render(){
  return (
    <div className="App">
     
      <Navigation/>
    </div>
  );
}
}

export default App;
